    //console.log(Object.keys(exercises.exercises))


    return (
        <div className="exercise_list">
            <ul>
               <li>test</li>
               {exercises.exercises.map((exercise) => (
                <li>{exercise}</li>
                ))}
            </ul>
        </div>
    )

}

export default ExerciseList;

